import styil from './home.module.scss';

const Home = () => {
	return (
		<div className={styil.root}>
			<div className="container">
				<div className={styil.body}>
					<div className={styil.content}>hi i am page home</div>
				</div>
			</div>
		</div>
	);
};

export default Home;
